import React from 'react';
import classes from "./css/SideBar.module.css";

const Sidebar = ({ isVisible, content }) => {
    return (
        <div className={`${classes.sidebar} ${isVisible ? `${classes.visible}` : ''}`}>
            {content}
        </div>
    );
};

export default Sidebar;
